import React from 'react';
import ReturndAsh from './Dash';
import ClipLoader from 'react-spinners/ClipLoader';
import './Loading.css';

// Dash Component Admin
export default function AdmindAsh() {

 const [loading, setLoading] = React.useState(false);

 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 1500);

 }, []);

 return (
  <div className='App-loading'>
   {
    loading ?

     <div>


      <ClipLoader
       size={30}
       color={'#123abc'}
       loading={loading}
      />
     </div>
     :
     <ReturndAsh />
   }
  </div>
 )
};
